INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3270160893522', 'Cheeseburger Viande charolaise, cheddar, sauce barbecue surgelés', 'Préparation à base de farine [farine de blé (_gluten_), poudre au beurre (_lait_), sucre, sel, dextrose de blé, jaune d\'_oeuf_ en poudre, _gluten_ de blé, émulsifiant : mono- et diglycérides d\'acides gras d\'origine végétale, farine de blé maltée (_gluten_), agent de traitement de la farine : acide ascorbique], steak haché de boeuf charolais* cuit (France) 26,2%, cheddar rouge 10,5% (_lait_, sel, ferments lactiques, présure, coagulant, colorant : rocou), sauce barbecue 10,5% [eau, sucre, concentré de tomates 1,2%, vinaigre 0,9%, amidon transformé de maïs, sel, sel fumé, extrait de malt d\'orge (_gluten_), plantes aromatiques, épice 0,01%], tomate marinée 7,3% (tomate mi-séchée, huile de colza, sucre, sel, ail, herbes aromatiques, antioxydant : acide ascorbique), cornichon aigre-doux 3,6% (cornichon, eau, vinaigre, sucre, sel, aneth, graine de _moutarde_), oignon rouge 2,6%, eau, levure, levure désactivée. ', 'https://static.openfoodfacts.org/images/products/327/016/089/3522/front_fr.10.400.jpg', '10.5', '5.6', '25.2', '8', '1.8', '11.6', '1', '0.393700787401575', '', '0');

